import React, { Component } from 'react'

export default class PhoneNumberInput extends Component {
  render() {
    return (
      <div>

                <label for="inputZip">Phone Number</label>
                <input type="text" classname="form-control" id="1+(XXX)XXX-XXX"></input>
               </div>
    )
  }
}
